export default function Cabecalho(props){
    return(
            <header className="cab">
                <img src={props.logo}/>
                <img src={props.menu}/>
                <input></input>
                <button><img src={props.lupa}></img></button>
                <img src={props.fav}></img>
                <img src={props.usuario}></img>
                <img src='../../../image/sacola.png'></img>
            </header>
        )
}
